import React from 'react';
import './Register.css';
import RegisterDetails from '../Register/RegisterDetails';

const registerComponent = (props) => {
    registerDetails : RegisterDetails = props.object;
  return (
    <div>
          <div id="signup">
                <input type="text" id="first" placeholder="First Name" value = {props.object.re}/>
                <input type="text" id="last" placeholder="Last Name"/>
                <input type="email" id="email" placeholder="Email"/>
            <input type="password" id="password" placeholder="Password"/>
            <input type="text" id="address1" placeholder="Adress 1"/>
              <input type="text" id="address2" placeholder="Adress 2"/>
                <input type="text" id="city" placeholder="City"/>
                  <input type="text" id="state" placeholder="State"/>
                    <input type="text" id="country" placeholder="Country"/>
                      <input type="text" id="zipcode" placeholder="zipcode"/>
                        <input type="text" id="usertype" placeholder="usertype"/>
            <button id="send">Send</button>
    </div>
        </div>
  );

}

export default registerComponent;
